import {View, TextInput, Image, ScrollView, Text } from "react-native"
import { RouteProp } from '@react-navigation/native';
import { StackNavigationProp } from '@react-navigation/stack';

import styles from "./style"

type Inf_acao = {
    logourl: string
}

type InfoScreenRouteProp = RouteProp<RootStackParamList, 'Info'>;
type InfoScreenNavigationProp = StackNavigationProp<RootStackParamList, 'Info'>;

type InfoScreenProps = {
    route: InfoScreenRouteProp;
    navigation: InfoScreenNavigationProp;
  };

type RootStackParamList = {
    Info: { inf_acao: Inf_acao };
  };

export default function Info({ inf_acao }: { inf_acao: Inf_acao }){
    return(
        <View>{inf_acao.logourl}</View>
    )
}
